import React ,{useEffect}from 'react';

import { Jumbotron } from 'reactstrap';

const About=()=>{

    useEffect( () => {
        document.title="About";
    },[]);
    

    return (
        <div>
            <Jumbotron>
                <ul className="my-5">
                    <li><b>This application is developed using Spring Boot</b></li>
                    <li><b>Database integration is done using Hibernate/JPA </b></li>
                    <li><b>Any open source database – MySQL is used</b></li>
                    <li><b>AFor frontend – JSP/Angular/REACT can be used</b></li>
                </ul>
                

            </Jumbotron>
        </div>
    )
};

export default About;
